import React from 'react';
// import logo from './logo.svg';
// import * as mui from '@material-ui/core'
// import * as rb from 'react-bootstrap'

// import 'bootstrap/dist/css/bootstrap.min.css';
// import './App.css';

import Joke from './Componenets/Joke'
import jokesData from './Componenets/jokesData'

function App(){

  jokesData.map(function(joke){
    return (
      <Joke question={joke.question} punchLine={joke.punchLine}/>
    )
  })

  return(
    <div>
      <Joke question="What is this?" punchLine="Those are apples!"/>
      <Joke punchLine="Those are apples!"/>
      <Joke question="What is this?" punchLine="Those are apples!"/>
      <Joke question="What is this?" punchLine="Those are apples!"/>
      <Joke question="What is this?" punchLine="Those are apples!"/>
    </div>
  )
}

export default App
